import React from 'react';
import Price from "./Price";
import {StyleSheet} from 'aphrodite';
import {useMediaQuery} from "react-responsive";
import {RESPONSIVE} from "../../../../responsive/Responsive";

function PricePhone(props) {
    const styleBIG = StyleSheet.create({
        doodle: {
            top: "-10%",
            width: "8rem"
        },

        clickable: {
            top: "14.5rem",
            width: "7rem"
        },
        saly: {
            left: "60%",
            top: "0",
            width: "14rem"
        },
    })
    const styleMINI = StyleSheet.create({
        doodle: {
            top: "-10%",
            width: "8rem"
        },

        clickable: {
            top: "14.5rem",
            width: "7rem"
        },
        saly: {
            left: "40%",
            top: "100%",
            width: "14rem"
        },
    });
    const mobile_mini = useMediaQuery(RESPONSIVE.MINI_MOBILE);
    const style = mobile_mini ? styleMINI : styleBIG;
    return (
        <Price unique_style={style}>
        </Price>
    );
}

export default PricePhone;
